INSERT INTO `trick` (`id`, `category_id`, `name`, `content`, `slug`, `created_at`, `updated_at`) VALUES
	(1, 5, 'Nose slide', 'Le nose slide est un des slides les plus faciles à faire en skateboard. Il consiste à glisser sur le nose de la planche sur un obstacle glissant. Particulièrement stable, il ne nécessite pas énormément d’équilibre et peut même se faire sans ollie. Bref, c', 'snow_trick_Nose slide', '2022-02-05 12:14:05', '2022-04-05 12:14:06'),
	(2, 3, '180', 'Le Backside 180 peut s’expliquer en plusieurs phases :\r\n1 - La phase d’approche consiste à avoir sa planche la plus à plat possible ou légèrement sur la carre frontside ; le regard est pointé vers le spot (l’endroit où on veut décoller). Les jambes sont f', 'snow_trick_180', '2022-04-05 13:44:39', '2022-04-05 13:44:40'),
	(3, 3, '360', 'La suite des conseils de Tonton Franky après le Ollie et le 180, qui nous apprend en mots et en vidéo comment on tourne un backside 360 dans les règles de l\'art.\r\nLe 3.6 back ou backside 3 est une des rotations les plus faciles du snowboard. C’est une rot', 'snow_trick_360', '2022-04-05 13:44:41', '2022-04-05 13:44:40'),
	(4, 3, '720', 'Dans la série des Tutoriels de Tonton Franky, on passe au Frontside 720 ou 7.2 Front, comme son nom l’indique une rotation de 2 tours en frontside.\r\n\r\nLorsque l’on pense essayer ce tricks, c’est que l’on maitrise déjà très bien le 3.6 et le 5.4 front, n\'h', 'snow_trick_720', '2022-04-05 13:44:42', '2022-04-05 13:44:43'),
	(5, 6, 'Backside air', '1) Drop in from your toeside wall. Make sure your knees are bent, shoulders parallel to your stance and you’ve got enough speed to get out the lip of the pipe.\r\n\r\n2) Once you’re safely through the transition, look at the part of the wall you’re going to h', 'snow_trick_Backside air', '2022-04-05 13:44:44', '2022-04-05 13:44:43'),
	(6, 4, 'Front flip', 'How To Front flip  (tamedog)\r\nNow, don\'t let the name of this trick fool you... The Front flip  is not for the tame hearted! It\'s loads of fun though once you have it. \r\n\r\nBefore we flip into how to throw down clean looking Front flip s, check out our Str', 'snow_trick_Front flip', '2022-04-05 13:44:45', '2022-04-05 13:44:45'),
	(7, 1, 'Indy grab', 'How to Indy Grab on a Snowboard\r\n\r\nAn Indy grab is where the back hand grabs the toe edge between the feet. The board is kept flat. This grab will feel more natural than the Mute due to the tendency towards riding with a more open posture.\r\n\r\nApproach:\r\nS', 'snow_trick_Indy grab', '2022-04-05 13:44:47', '2022-04-05 13:44:46'),
	(8, 6, 'Japan air', 'How To Japan On A Tramp Board\r\nA Japan is essentially a Mute grab that you tweak behind your back!\r\n\r\nA good tweaked out Japan is super entertaining to watch and even more amusing to stomp. Adding Japan grabs to your tricks is a sure fire way to get props', 'snow_trick_Japan air', '2022-04-05 13:44:47', '2022-04-05 13:44:48'),
	(9, 6, 'Method air', 'A Method is one of most iconic tricks in snowboarding that never goes out of style. In this tutorial, we\'ll be sharing the best way to learn this seriously cool trick and show you how to tweak it out.\r\n\r\nLoving the Method? Then you\'ll love the rest of our', 'snow_trick_Method air', '2022-04-05 13:44:49', '2022-04-05 13:44:48'),
	(10, 1, 'Mute', 'A Mute grab is never a go to trick, but it’s really worth the effort to try as it will correct minor posture issues that arise from riding slightly open, so improving your overall freestyle positioning.\r\n\r\nA Mute grab is where the front hand grabs the toe', 'snow_trick_Mute', '2022-04-05 13:44:49', '2022-04-05 13:44:50'),
	(11, 1, 'Nose grab', 'Nose & Tail Grabs have the easiest names to remember of any grab but are a little tricker than the four basic grabs. This is because they require the addition of leg extensions in the air to get the grab. We break these two grabs down and show you how to ', 'snow_trick_Nose grab', '2022-04-05 13:44:51', '2022-04-05 13:44:51'),
	(12, 1, 'Tail grab', 'Nose & Tail Grabs have the easiest names to remember of any grab but are a little tricker than the four basic grabs. This is because they require the addition of leg extensions in the air to get the grab. We break these two grabs down and show you how to ', 'snow_trick_Tail grab', '2022-04-05 13:44:52', '2022-04-05 13:44:52'),
	(13, 1, 'Stalefish grab', 'A Stalefish is when you grab your heelside edge (between your feet) with your rear hand.', 'snow_trick_Stalefish grab', '2022-04-05 13:44:53', '2022-04-05 13:44:53'),
	(14, 5, 'Tail slide', 'The Nose & Tail Slide is a super rad, relatively simple trick because it just a variation of Boardslides. In this tutorial we will break the tricks down and show you how to dial it in at home so you can confidently take it to the hill. If you\'re looking f', 'snow_trick_Tail slide', '2022-04-05 13:44:54', '2022-04-05 13:44:55'),
